import React from 'react'

import './home.css'
import { useNavigate } from 'react-router-dom';

const Home = (props) => {

  const navigate = useNavigate();

  const handleLogin = () => {
    navigate('/login');
  };

  return (
    <div className="home-container">
      <span className="home-text">Teaming</span>
      <div className="home-container1"></div>
      <button type="button" className="home-button button" onClick={handleLogin}>
        <span>
          <span>Login</span>
          <br></br>
        </span>
      </button>
      <input
        type="text"
        placeholder="검색어를 입력하세요"
        className="home-textinput input"
      />
    </div>
  )
}

export default Home
